// components/CustomModal.jsx
import {
    TextInput,
    Dialog,
    DialogTitle,
    DialogContent,
    DialogActions,
    Button
} from '@mui/material';

const InventoryModal = ({ isOpen }) => {
    return (
        <Dialog open={isOpen} maxWidth="sm" fullWidth>
            <DialogTitle>Save Inventory</DialogTitle>
            <DialogContent dividers>
                <TextInput />
                <TextInput />
            </DialogContent>
            <DialogActions>
                <Button onClick={onSave} color="inherit">Save</Button>
            </DialogActions>
        </Dialog>
    );
};

export default InventoryModal;
